const App = () =>{
  return (
    <div className="App">
      <section className="side-bar">
        <button>+ New Chat</button>
        <ul className="history">
          <li>Chat 1</li>
          <li>Chat 2</li>
          <li>Chat 3</li>
        </ul>
        <nav>
          <p><a href="https://www.linkedin.com/in/george-yu-a6800a227/" target="blank">Made By Baichuan</a></p>
        </nav>
      </section>
      <section className="main"></section>

    </div>
  );
}

export default App;
